import { Link } from "react-router-dom";
import "./NavBar.css";
const NavBar = () => {
  return (
    <>
      <nav className="navbar">
        <div className="navbar-contain">
          <ul className="navbar-nav">
            <li className="nav-item">
              <Link className="nav-link active" to="/sobreNosotros">
                Sobre nosotros
              </Link>
            </li>
            <li className="nav-item">
              {/* <Link className="nav-link" to="/miCuenta">
                Mi cuenta
              </Link> */}
              <label class="btn" for="modal-1">
                Show me modal with a cat
              </label>
            </li>
            <li className="nav-item-resalt">
              <Link className="nav-link" to="/agendarCita">
                !Agendar tu citaÂ¡
              </Link>
            </li>
          </ul>
        </div>
      </nav>
    </>
  );
};

export default NavBar;
